import React, { useState, useCallback} from 'react';
import './style.css';

function TodoListNext() {
  const [inputValue, setInputValue] = useState('')

  const isClick = (initialValue = false) => {
  const [isOpen, setIsOpen] = useState(initialValue);

  const toggle = useCallback(() => {
    setIsOpen((prevState) => !prevState);
  }, []);

  return [isOpen, toggle] as const;
};
  return (
    <div>
      {inputValue}
      <br />
      <button className="todoBtn" onClick={()=>{setInputValue('クリックした')}}>＋</button>
      <button className="todoBtn" onClick={isClick()}>＋</button>
      {isOpen ?  <p>あるよ</p>: <p>ないよ</p>}
    </div>
  );
}

export default TodoListNext;
